import{_ as i,c as e,o as a,V as l}from"./chunks/framework.7XExV1ji.js";const t="/nav/assets/opening.Ax6Iktvb.jpg",o="/nav/assets/saving.kqCz-_ho.jpg",s="/nav/assets/coedit.C_1UtJCU.jpg",g=JSON.parse('{"title":"ONLYOFFICE工作原理","description":"","frontmatter":{},"headers":[],"relativePath":"efficiency/software/onlyoffice.md","filePath":"efficiency/software/onlyoffice.md","lastUpdated":1720851179000}'),c={name:"efficiency/software/onlyoffice.md"},n=l('<div class="tip custom-block"><p class="custom-block-title">额外知识</p><p>ONLYOFFICE Docs 是一款免费的协作在线办公套件,包括文本、电子表格和演示文稿、表单和 PDF 的查看器和编辑器，与 Office Open XML 格式完全兼容：.docx、.xlsx、.pptx，并支持实时协作编辑。</p></div><h1 id="onlyoffice工作原理" tabindex="-1">ONLYOFFICE工作原理 <a class="header-anchor" href="#onlyoffice工作原理" aria-label="Permalink to &quot;ONLYOFFICE工作原理&quot;">​</a></h1><h2 id="打开文件" tabindex="-1">打开文件 <a class="header-anchor" href="#打开文件" aria-label="Permalink to &quot;打开文件&quot;">​</a></h2><p><img src="'+t+'" alt="Image 1"></p><ol><li>用户使用文档管理器打开文档进行查看或者编辑。（基于浏览器访问）</li><li>使用JavaScript API 将文档唯一标识符（key）以及文档URL（url）发送到文档编辑器。</li><li>文档编辑器向文档编辑服务发送一个打开文档的请求。</li><li>文档编辑服务从文档存储服务下载相对应的文档，并将文档转换为Office Open XML格式。</li><li>准备就绪后，文档编辑服务会将转化后的文档传输到基于浏览器的文档编辑器。</li><li>提供编辑或者查看权限，对文档进行相应操作，执行保存。</li></ol><h2 id="保存文件" tabindex="-1">保存文件 <a class="header-anchor" href="#保存文件" aria-label="Permalink to &quot;保存文件&quot;">​</a></h2><p><img src="'+o+'" alt="Image 2"></p><ol><li>用户在文档编辑器中编辑文件。</li><li>文档编辑器将更改发送给文档编辑服务。</li><li>用户关闭文档编辑器或触发手动保存。</li><li>文档编辑服务监视到文档结束工作，并收集从文档编辑器发送到一个文档中的更改</li><li>执行回调保存接口</li><li>返回状态</li></ol><h2 id="协同编辑" tabindex="-1">协同编辑 <a class="header-anchor" href="#协同编辑" aria-label="Permalink to &quot;协同编辑&quot;">​</a></h2><p><img src="'+s+'" alt="Image 3"></p><ol><li>用户1和用户2在文档编辑器中打开同一个文档，即打开文件时已使用一个相同的document.key</li><li>用户1对打开的文档进行更改。</li><li>文档编辑器将用户1所做的更改发送到文档编辑服务。</li><li>文档编辑服务将用户1所做的更改发送给用户2文档编辑器。</li><li>现在用户2可以看到这些变化。</li></ol>',11),r=[n];function f(p,_,d,h,m,u){return a(),e("div",null,r)}const k=i(c,[["render",f]]);export{g as __pageData,k as default};
